import ProfilePage from "./components/pages/profile/ProfilePage";
class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }

  render() {
    return (
      <Switch>
        <Route exact path="/" component={LoginPage} />
        <Route path="/profile" component={ProfilePage} />
      </Switch>
    );
  }
}

export default connect(
